import React from 'react'
import { base_url } from '../custom/httpCustomValues'
import axios from 'axios'

export default function Issues () {
  axios.get(base_url + '/issues')

  return (
    <React.Component>
      <div>
        <ul>
          {this.getIssue().map(issue => {
            ;<li key={issue.id}> {issue.data} </li>
          })}
        </ul>
      </div>
    </React.Component>
  )
}
